import NavBar from "./Components/NavBar";
import { Switch, Route } from 'react-router-dom';
import Seminars from "./pages/Seminars";
import Users from "./pages/Users";
import Teams from "./pages/Teams";
import SeminarType from "./pages/SeminarType";



function App() {



  return (
    <div>
       <NavBar ></NavBar>
       <Switch>
         <Route exact path='/'>
           <Seminars />
         </Route>
         <Route exact path='/users'>
           <Users />
         </Route>
         <Route exact path='/teams'>
           <Teams />
         </Route>
         <Route exact path='/seminartype'>
           <SeminarType />
         </Route>
         <Route exact path='/seminartype'>
           <SeminarType />
         </Route>
       </Switch>







    </div>
  );
}

export default App;
